column2:
МОПы профессиональной серии ЛАЙМА "Expert" предназначены для влажной и сухой уборки любых твердых поверхностей, таких, как ламинат, плитка, паркет и др. МОП произведен из высококачественных материалов. Выдерживает до 300 циклов стирки.
Состав: 100% хлопок.
Тип крепления - универсальный (различные аналоги креплений - уши / карманы).

МОП для влажной уборки из хлопка предназначен для уборки твердых поверхностей: плитка, кафель, ламинат, паркет и др. МОП изготовлен из хлопка и имеет форму плоского прямоугольника - такая форма позволяет удобно собрать грязь по углам и захватить большую площадь убираемой поверхности, что, в свою очередь, сокращает временные затраты на уборку больших площадей. Максимальный объем впитывания: 60 см - 600 мл.

Сфера применения:
гостиницы, рестораны, кафе, бары;
учреждения здравоохранения;
промышленные предприятия;
повседневная уборка.

Уход за изделием:
стирка при температуре 30 - 60° С;
не допускается сушка в барабане стиральной машины;
не отбеливать;
есть цветовая кодировка.

Салфетка из микрофибры идеально удаляет загрязнения, вытирает пыль, полирует любые виды поверхностей. Обладает повышенной впитываемостью и антибактериальным эффектом, имеет длительный срок службы. Универсальна в применении.
Преимущества микрофибры:
- устойчивость к влаге; благодаря особому строению ткани микрофибра впитывает в 4 раза больше жидкости, нежели тряпки из других материалов;
- тряпка после отжимания мгновенно становится сухой;
- стойкие цвета, которые сделают процесс уборки нескучным занятием, также при многократной стирке микрофибра не приобретет застиранный вид;
- не оставляет после себя разводы и ворсинки.
